import { useState, useEffect } from "react";

function User() {
  const loadUser = async () => {
    const res = await fetch("http://localhost:3001/userdb");
    console.log(res);
  };

  useEffect(() => {
    loadUser;
  }, []);

  return <h1>User</h1>;
}

export default User;
